export default function Detailpage() {
    return (
        <div style={{ width: "1169.8px", background: "red" , position: "relative"}}>

            <div style={{ position: "absolute", left: 0 }} >
                <Detail />
            </div>
            <div style={{ position: "absolute", right: 0 }}>
                <Comment />
            </div>

        </div>
    )
}
